import React, {useState} from 'react';
import Typical from 'react-typical'

class TitlePage extends React.Component {
  render() {
    <Typical
      loop={Infinity}
      wrapper="b"
      steps={['justinsantos']}
    />
  }
}

export default TitlePage;
